import data from "../../utils/data";
import Card from "../Card/Card";
export default function Shop() {
  return (
    <div>
      {data.map((obj) => {
        if (obj.id === 1 || obj.id === 2) {
          return (
            <div>
              <Card key={obj.id} {...obj}></Card>
            </div>
          );
        }
      })}
      <img src=""></img>
    </div>
  );
}
